  \"crescent-lake-national-wildlife-refuge-narrative-report-january-1-to-december-31-1964\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Crescent
  Lake National Wildlife Refuge outlines Refuge accomplishments during the 1964 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, collections
  and receipts, vegetation control, prescribed burning, and wildfires. Resource management
  is outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, fishing,
  and safety. Items of interest, N-R forms, and photographs are attached. A short
  narrative report of North Platte National Wildlife Refuge is included.\",\n\t\"license_title\":
